import Home from './Components/Home.jsx'
import Layout from './Components/Layout.jsx'
import './App.css';




function App() {
  return (
    <div className="App">
      <header className="App-header">
        bluehouse
      </header>
      <main>
        <Layout>
          <Route exact path='/'>
            <Home/>
          </Route>
        </Layout>


      </main>
    </div>
  );
}

export default App;
